0:01','2022-01-08 08:10:01','<!-- wp:image {\"id\":12,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://woodmen.wip/app/uploads/2022/01/central-railroad-station-building-1907-3252.png\" alt=\"\" class=\"wp-image-12\"/><figcaption>Floor installation</figcaption></figure>\n<!-- /wp:image -->','Floor installation','','inherit','closed','closed','','11-revision-v1','','','2022-01-08 08:10:01','2022-01-08 08:10:01','',11,'https://woodmen.wip/?p=13',0,'revision','',0),(14,1,'2022-01-08 08:11:42','2022-01-08 08:11:42','','Wall isolation','','publish','open','open','','wall-isolation','','','2022-01-22 05:46:29','2022-01-22 05:46:29','',0,'https://woodmen.wip/?p=14',0,'post','',0),(15,1,'2022-01-08 08:11:16','2022-01-08 08:11:16','','Cube-house-Rotterdam-Netherlands','','inherit','open','closed','','cube-house-rotterdam-netherlands','','','2022-01-08 08:11:16','2022-01-08 08:11:16','',14,'https://woodmen.wip/app/uploads/2022/01/Cube-house-Rotterdam-Netherlands.jpeg',0,'attachment','image/jpeg',0),(16,1,'2022-01-08 08:11:42','2022-01-08 08:11:42','<!-- wp:image {\"id\":15,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://woodmen.wip/app/uploads/2022/01/Cube-house-Rotterdam-Netherlands-1024x769.jpeg\" alt=\"\" class=\"wp-image-15\"/><figcaption>Wall isolation</figcaption></figure>\n<!-- /wp:image -->','Wall isolation','','inherit','closed','closed','','14-revision-v1','','','2022-01-08 08:11:42','2022-01-08 08:11:42','',14,'https://woodmen.wip/?p=16',0,'revision','',0),(17,1,'2022-01-08 08:23:29','2022-01-08 08:23:29','','Wall isolation','','inherit','closed','closed','','14-revision-v1','','','2022-01-08 08:23:29','2022-01-08 08:23:29','',14,'https://woodmen.wip/?p=17',0,'revision','',0),(18,1,'2022-01-08 08:25:56','2022-01-08 08:25:56','','Floor installation','','inherit','closed','closed','','11-revision-v1','','','2022-01-08 08:25:56','2022-01-08 08:25:56','',11,'https://woodmen.wip/?p=18',0,'revision','',0),(19,1,'2022-01-08 08:26:46','2022-01-08 08:26:46','','Roof repairing','','inherit','closed','closed','','8-revision-v1','','','2022-01-08 08:26:46','2022-01-08 08:26:46','',8,'https://woodmen.wip/?p=19',0,'revision','',0),(21,1,'2022-01-16 08:32:30','2022-01-16 08:32:30','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As an experienced organizer, McGuire believed that the trade of the carpenter could only be protected through the collective strength of workers. He spent 18 hours a day speaking, writing, and organizing to keep the union afloat, responding to one crisis after another—in St. Louis, Chicago, Toronto, Philadelphia, and New York. Slowly, the young union grew from 2,042 members in 1881 to 5,789 in 1885.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[71,72,70],\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-683x1024.jpg\" alt=\"\" data-id=\"71\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-scaled.jpg\" data-link=\"https://woodmen.wip/index.php/floor-installation/pexels-cottonbro-5089152/\" class=\"wp-image-71\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167-683x1024.jpg\" alt=\"\" data-id=\"72\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167.jpg\" data-link=\"https://woodmen.wip/index.php/roof-repairing/pexels-cottonbro-5089167/\" class=\"wp-image-72\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178-683x1024.jpg\" alt=\"\" data-id=\"70\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178.jpg\" data-link=\"https://woodmen.wip/index.php/es/aislamiento-de-muros/pexels-cottonbro-5089178/\" class=\"wp-image-70\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>In 1886, 340,000 workers demonstrated for shorter hours in cities across the U.S.; historians labeled it “the year of the great uprising of labor.” Workers from every industry participated, but building tradesmen were the central force. UBC locals led marches around the country, inspiring others with their determination.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Strikes and demonstrations over hours and wages took place in Canada during this period. In 1887, 700 carpenters and 400 non-union men walked off the job in Toronto over demands for a nine-hour day and a raise from 22.5 to 25 cents per hour.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Not surprisingly, the Brotherhood’s top officer was one of the major North American spokesmen for the strikers. McGuire and UBC General President Gabriel Edmonston even devised a May 1 general strike that paid handsome dividends: Union carpenters won higher wages and better conditions in 53 cities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:verse -->\n<pre class=\"wp-block-verse\">Such successes attracted thousands of unorganized carpenters to the union, which swelled to 21,423 members by the summer of 1886. Four years later, membership topped 50,000. McGuire called the UBC “the largest and most powerful organization, numerically, of any special trade in the whole civilized world.”</pre>\n<!-- /wp:verse -->','About us','','publish','closed','closed','','about-us','','','2022-01-24 00:34:10','2022-01-24 00:34:10','',0,'https://woodmen.wip/?page_id=21',0,'page','',0),(22,1,'2022-01-16 08:32:30','2022-01-16 08:32:30','','Acerca de','','inherit','closed','closed','','21-revision-v1','','','2022-01-16 08:32:30','2022-01-16 08:32:30','',21,'https://woodmen.wip/?p=22',0,'revision','',0),(24,1,'2022-01-16 08:33:14','2022-01-16 08:33:14','','About Us','','inherit','closed','closed','','21-revision-v1','','','2022-01-16 08:33:14','2022-01-16 08:33:14','',21,'https://woodmen.wip/?p=24',0,'revision','',0),(25,1,'2022-01-16 08:33:23','2022-01-16 08:33:23','','About us','','inherit','closed','closed','','21-revision-v1','','','2022-01-16 08:33:23','2022-01-16 08:33:23','',21,'https://woodmen.wip/?p=25',0,'revision','',0),(26,1,'2022-01-16 08:33:44','2022-01-16 08:33:44','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>Wh