- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As an experienced organizer, McGuire believed that the trade of the carpenter could only be protected through the collective strength of workers. He spent 18 hours a day speaking, writing, and organizing to keep the union afloat, responding to one crisis after another—in St. Louis, Chicago, Toronto, Philadelphia, and New York. Slowly, the young union grew from 2,042 members in 1881 to 5,789 in 1885.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:gallery {\"ids\":[71,72,70],\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-683x1024.jpg\" alt=\"\" data-id=\"71\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-scaled.jpg\" data-link=\"https://woodmen.wip/index.php/floor-installation/pexels-cottonbro-5089152/\" class=\"wp-image-71\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167-683x1024.jpg\" alt=\"\" data-id=\"72\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167.jpg\" data-link=\"https://woodmen.wip/index.php/roof-repairing/pexels-cottonbro-5089167/\" class=\"wp-image-72\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178-683x1024.jpg\" alt=\"\" data-id=\"70\" dat