Workers from every industry participated, but building tradesmen were the central force. UBC locals led marches around the country, inspiring others with their determination.</p>\n<!-- /wp:paragraph -->','Trabajos','','publish','closed','closed','','trabajos','','','2022-01-24 00:35:54','2022-01-24 00:35:54','',0,'https://woodmen.wip/?page_id=48',0,'page','',0),(49,1,'2022-01-16 10:00:05','2022-01-16 10:00:05','','Trabajos','','inherit','closed','closed','','48-revision-v1','','','2022-01-16 10:00:05','2022-01-16 10:00:05','',48,'https://woodmen.wip/?p=49',0,'revision','',0),(51,1,'2022-01-16 10:39:46','2022-01-16 10:39:46','','We love working with wood','','publish','open','open','','we-love-working-with-wood','','','2022-01-23 18:05:57','2022-01-23 18:05:57','',0,'https://woodmen.wip/?p=51',0,'post','',0),(52,1,'2022-01-16 10:39:35','2022-01-16 10:39:35','','pexels-burst-374861','','inherit','open','closed','','pexels-burst-374861','','','2022-01-16 10:39:35','2022-01-16 10:39:35','',51,'https://woodmen.wip/app/uploads/2022/01/pexels-burst-374861.jpg',0,'attachment','image/jpeg',0),(53,1,'2022-01-16 10:39:46','2022-01-16 10:39:46','<!-- wp:image {\"id\":52,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-burst-374861-1024x576.jpg\" alt=\"\" class=\"wp-image-52\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','We love working with wood','','inherit','closed','closed','','51-revision-v1','','','2022-01-16 10:39:46','2022-01-16 10:39:46','',51,'https://woodmen.wip/?p=53',0,'revision','',0),(54,1,'2022-01-16 10:40:20','2022-01-16 10:40:20','','Nos encanta trabajar con madera','','publish','open','open','','nos-encanta-trabajar-con-madera','','','2022-01-23 18:05:29','2022-01-23 18:05:29','',0,'https://woodmen.wip/?p=54',0,'post','',0),(55,1,'2022-01-16 10:40:20','2022-01-16 10:40:20','','Nos encanta trabajar con made