'2022-01-19 00:29:14','',8,'https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167.jpg',0,'attachment','image/jpeg',0),(73,1,'2022-01-19 00:34:54','2022-01-19 00:34:54','','Roof repairing','ONLY REAL WOOD','inherit','closed','closed','','8-revision-v1','','','2022-01-19 00:34:54','2022-01-19 00:34:54','',8,'https://woodmen.wip/?p=73',0,'revision','',0),(75,1,'2022-01-21 23:04:59','2022-01-21 23:04:59','','pexels-alex-smith-1051348','','inherit','','closed','','pexels-alex-smith-1051348','','','2022-01-21 23:04:59','2022-01-21 23:04:59','',21,'https://woodmen.wip/app/uploads/2022/01/pexels-alex-smith-1051348.jpg',0,'attachment','image/jpeg',0),(76,1,'2022-01-21 23:05:35','2022-01-21 23:05:35','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote></figure>\n<!-- /wp:pullquote -->','About us','','inherit','closed','closed','','21-revision-v1','','','2022-01-21 23:05:35','2022-01-21 23:05:35','',21,'https://woodmen.wip/?p=76',0,'revision','',0),(77,1,'2022-01-21 23:05:56','2022-01-21 23:05:56','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As an experienced organizer, McGuire believed that the trade of the carpenter could only be protected through the collective strength of workers. He spent 18 hours a day speaking, writing, and organizing to keep the union afloat, responding to one crisis after another—in St. Louis, Chicago, Toronto, Philadelphia, and New York. Slowly, the young union grew from 2,042 members in 1881 to 5,789 in 1885.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1886, 340,000 workers demonstrated for shorter hours in cities across the U.S.; historians labeled it “the year of the great uprising of labor.” Workers from every industry participated, but building tradesmen were the central force. UBC locals led marches around the country, inspiring others with their determination.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Strikes and demonstrations over hours and wages took place in Canada during this period. In 1887, 700 carpenters and 400 non-union men walked off the job in Toronto over demands for a nine-hour day and a raise from 22.5 to 25 cents per hour.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Not surprisingly, the Brotherhood’s top officer was one of the major North American spokesmen for the strikers. McGuire and UBC General President Gabriel Edmonston even devised a May 1 general strike that paid handsome dividends: Union carpenters won higher wages and better conditions in 53 cities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Such successes attracted thousands of unorganized carpenters to the union, which swelled to 21,423 members by the summer of 1886. Four years later, membership topped 50,000. McGuire called the UBC “the largest and most powerful organization, numerically, of any special trade in the whole civilized world.”</p>\n<!-- /wp:paragraph -->','About us','','inherit','closed','closed','','21-revision-v1','','','2022-01-21 23:05:56','2022-01-21 23:05:56','',21,'https://woodmen.wip/?p=77',0,'revision','',0),(79,1,'2022-01-21 23:09:59','2022-01-21 23:09:59','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph --