/div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer {\"height\":285} -->\n<div style=\"height:285px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','About us','','inherit','closed','closed','','21-revision-v1','','','2022-01-24 00:32:46','2022-01-24 00:32:46','',21,'https://woodmen.wip/?p=115',0,'revision','',0),(116,1,'2022-01-24 00:34:07','2022-01-24 00:34:07','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As an experienced organizer, McGuire believed that the trade of the carpenter could only be protected through the collective strength of workers. He spent 18 hours a day speaking, writing, and organizing to keep the union afloat, responding to one crisis after another—in St. Louis, Chicago, Toronto, Philadelphia, and New York. Slowly, the young union grew from 2,042 members in 1881 to 5,789 in 1885.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[71,72,70],\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-683x1024.jpg\" alt=\"\" data-id=\"71\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-scaled.jpg\" data-link=\"https://woodmen.wip/index.php/floor-installation/pexels-cottonbro-5089152/\" class=\"wp-image-71\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167-683x1024.jpg\" alt=\"\" data-id=\"72\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167.jpg\" data-link=\"https://woodmen.wip/index.php/roof-repairing/pexels-cottonbro-5089167/\" class=\"wp-image-72\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178-683x1024.jpg\" alt=\"\" data-id=\"70\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178.jpg\" data-link=\"https://woodmen.wip/index.php/es/aislamiento-de-muros/pexels-cottonbro-5089178/\" class=\"wp-image-70\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>In 1886, 340,000 workers demonstrated for shorter hours in cities across the U.S.; historians labeled it “the year of the great uprising of labor.” Workers from every industry participated, but building tradesmen were the central force. UBC locals led marches around the country, inspiring others with their determination.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Strikes and demonstrations over hours and wages took place in Canada during this period. In 1887, 700 carpenters and 400 non-union men walked off the job in Toronto over demands for a nine-hour day and a raise from 22.5 to 25 cents per hour.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Not surprisingly, the Brotherhood’s top officer was one of the major North American spokesmen for the strikers. McGuire and UBC General President Gabriel Edmonston even devised a May 1 general strike that paid handsome dividends: Union carpenters won higher wages and better conditions in 53 cities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:verse -->\n<pre class=\"wp-block-verse\">Such successes attracted thousands of unorganized carpenters to the union, which swelled to 21,423 members by the summer of 1886. Four years later, membership topped 50,000. McGuire called the UBC “the largest and most powerful organization, numerically, of any special trade in the whole civilized world.”</pre>\n<!-- /wp:verse -->','About us','','inherit','closed','closed','','21-revision-v1','','','2022-01-24 00:34:07','2022-01-24 00:34:07','',21,'https://woodmen.wip/?p=116',0,'revision','',0),(117,1,'2022-01-24 00:35:40','2022-01-24 00:35:40','','pexels-quintin-gellar-313773','','inherit','','closed','','pexels-quintin-gellar-313773','','','2022-01-24 00:35:40','2022-01-24 00:35:40','',48,'https://woodmen.wip/app/uploads/2022/01/pexels-quintin-gellar-313773.jpg',0,'attachment','image/jpeg',0),(119,1,'2022-01-24 00:38:47','2022-01-24 00:38:47','<!-- wp:paragraph -->\n<p>The United Brotherhood of Carpenters and Joiners of America (UBC) is one of North America’s largest building trades unions, with over a half-million members. With pride in our more than 140-year history, we lead the way in training, educating, and representing the next generation of skilled construction professionals. Learn more about UBC below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>While much has changed over the course of more than 140-years, the union today remains as committed as ever to improving the lives of those who make their living in the carpentry trades.</p><cite>leader of the 19th century, Peter J. McGuire</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>The early 1880s brought change to the carpentry trade. The number of large building employers was rising, and contractors were increasingly used to coordinate and supervise construction. It was becoming harder and harder for the average carpenter to become an independent master.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[117,72,71,70],\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-quintin-gellar-313773-1024x666.jpg\" alt=\"\" data-id=\"117\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-quintin-gellar-313773.jpg\" data-link=\"https://woodmen.wip/index.php/es/trabajos/pexels-quintin-gellar-313773/\" class=\"wp-image-117\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167-683x1024.jpg\" alt=\"\" data-id=\"72\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089167.jpg\" data-link=\"https://woodmen.wip/index.php/roof-repairing/pexels-cottonbro-5089167/\" class=\"wp-image-72\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-683x1024.jpg\" alt=\"\" data-id=\"71\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089152-scaled.jpg\" data-link=\"https://woodmen.wip/index.php/floor-installation/pexels-cottonbro-5089152/\" class=\"wp-image-71\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178-683x1024.jpg\" alt=\"\" data-id=\"70\" data-full-url=\"https://woodmen.wip/app/uploads/2022/01/pexels-cottonbro-5089178.jpg\" data-link=\"https://woodmen.wip/index.php/es/aislamiento-de-muros/pexels-cottonbro-5089178/\" class=\"wp-image-70\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>As an experienced organizer, McGuire believed that the trade of the carpenter could only be protected through the collective strength of workers. He spent 18 hours a day speaking, writing, and organizing to keep the union afloat, responding to one crisis after another—in St. Louis, Chicago, Toronto, Philadelphia, and New York. Slowly, the young union grew from 2,042 members in 1881 to 5,789 in 1885.</p>\n<!-- /wp:paragraph -->','Works','','inherit','closed','closed','','32-revision-v1','','','2022-01-24 00:38:47','2022-01-24 00:38:47','',32,'https://woodmen.wip/?p=119',0,'revision','',0),(120,1,'2022-04-07 20:05:55','0000-00-00 00:00:00','','Borrador automático','','auto-draft','','','','','','','2022-04-07 20:05:55','0000-00-00 00:00:00','',0,'https://woodmen.co.vu/?p=120',0,'post','',0),(121,1,'2022-04-07 20:23:38','2022-04-07 20:23:38','{\"version\": 2, \"isGlobalStylesUserThemeJSON\": true }','Custom Styles','','publish','closed','closed','','wp-global-styles-carpenter','','','2022-04-07 20:23:38','2022-04-07 20:23:38','',0,'https://woodmen.co.vu/wp-global-styles-carpenter/',0,'wp_global_styles','',0),(122,1,'2022-04-07 21:25:16','2022-04-07 21:25:16','{\n    \"blogname\": {\n        \"value\": \"Woodmen!\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-04-07 21:25:16\"\n    }\n}','','','trash','closed','closed','','18e61ec7-80ca-48a0-961c-25ce05ba3f82','','','2022-04-07 21:25:16','2022-04-07 21:25:16','',0,'https://woodmen.co.vu/18e61ec7-80ca-48a0-961c-25ce05ba3f82/',0,'customize_changeset','',0),(123,1,'2022-04-07 21:52:08','2022-04-07 21:52:08','','We love working with wood','','inherit','closed','closed','','51-autosave-v1','','','2022-04-07 21:52:08','2022-04-07 21:52:08','',51,'https://woodmen.co.vu/?p=123',0,'revision','',0);
