gin security, alerts, centralized management, and more.\",\"order\":0},{\"title\":\"Wordfence Premium\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-premium\\/\",\"excerpt\":\"Wordfence Premium comes with real-time firewall protection, real-time scan signatures, an IP address blocklist, country blocking, and Premium support.\",\"order\":1},{\"title\":\"Wordfence Care\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-care\\/\",\"excerpt\":\"Initial Setup After you have purchased Wordfence Care, you will receive a welcome email from our team with instructions on what to do next. You will use our encrypted form to send us credentials to access your site so that our Customer Service Engineers can set up and configure the Wordfence plugin and connect your&hellip;\",\"order\":2},{\"title\":\"Wordfence Response\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/wordfence-response\\/\",\"excerpt\":\"Initial Setup After you’ve purchased Wordfence Response, you’ll receive a welcome email from our team with instructions on what to do next. If you’ve purchased Wordfence Response because you need immediate Security Incident Response services, you can login to wordfence.com and visit the Licenses page, then click Get Help next to your Response License and&hellip;\",\"order\":3},{\"title\":\"Incident Response Services\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/incident-response-services\\/\",\"excerpt\":\"Let one of our Security Analysts help you clean your infected site or inspect it for vulnerabilities.\",\"order\":4},{\"title\":\"License Key\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/api-key\\/\",\"excerpt\":\"All Wordfence installations need a license key, also known as an API-key. The key can be a free key or a Premium key. \",\"order\":5},{\"title\":\"Account and Billing History\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/account\\/\",\"excerpt\":\"How to navigate and use your Wordfence account.\",\"order\":6},{\"title\":\"Wordfence Central\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/\",\"excerpt\":\"Wordfence Central provides a powerful and efficient way to manage the security of many WordPress sites via a single interface.\",\"children\":[{\"title\":\"Connecting your sites to Wordfence Central\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/connect\\/\",\"order\":0},{\"title\":\"Setting up two-factor authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/2fa\\/\",\"order\":1},{\"title\":\"Using the Dashboard page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/central\\/\",\"order\":2},{\"title\":\"Using the Configuration page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/configuration\\/\",\"order\":3},{\"title\":\"Using Wordfence plugin options Templates\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/templates\\/\",\"order\":4},{\"title\":\"Using the Settings page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/settings\\/\",\"order\":5},{\"title\":\"Using Wordfence Central Teams\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/teams\\/\",\"order\":6},{\"title\":\"Viewing scan Findings\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/findings\\/\",\"order\":7}],\"order\":7},{\"title\":\"Dashboard\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/\",\"excerpt\":\"The Wordfence Dashboard provides insight into the current state of your site’s security.\",\"children\":[{\"title\":\"Options\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/options\\/\",\"order\":0},{\"title\":\"Alerts\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/alerts\\/\",\"order\":1}],\"order\":8},{\"title\":\"Firewall\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/\",\"excerpt\":\"The Wordfence Web Application Firewall is a PHP based, application level firewall that filters out malicious requests to your site. \",\"children\":[{\"title\":\"Optimizing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/optimizing-the-firewall\\/\",\"order\":0},{\"title\":\"Learning Mode\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/learning-mode\\/\",\"order\":1},{\"title\":\"Statistics\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/statistics\\/\",\"order\":2},{\"title\":\"Options\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/options\\/\",\"order\":3},{\"title\":\"MySQLi storage engine\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/mysqli-storage-engine\\/\",\"order\":4},{\"title\":\"Brute Force Protection\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/brute-force\\/\",\"order\":5},{\"title\":\"Rate Limiting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/rate-limiting\\/\",\"order\":6},{\"title\":\"Troubleshooting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/troubleshooting\\/\",\"order\":7}],\"order\":9},{\"title\":\"Blocking\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/blocking\\/\",\"excerpt\":\"Aside from the firewall rules that protect against various attacks, Wordfence also has custom features for additional blocking. \",\"children\":[{\"title\":\"Country Blocking\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/blocking\\/country-blocking\\/\",\"order\":0},{\"title\":\"Blocking Troubleshooting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/blocking\\/troubleshooting\\/\",\"order\":1}],\"order\":10},{\"title\":\"Scan\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/scan\\/\",\"excerpt\":\"A Wordfence scan examines all files on your WordPress website looking for malicious code, backdoors, and shells that hackers have installed. It also scans for known malicious URLs and known patterns of infec